import React from 'react';

class Header extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isLoggedIn: false
        }
    }
    render() {
        console.log(this.state)
        let loginArea;
        if (this.state.isLoggedIn) {
            loginArea = (<p>hello, {this.state.userName}</p>);
        } else {
            loginArea = (<p>Please Login</p>);
        }

        return (
            { loginArea }
        );
    }
}

export default Header;
